  var pid,pname,pqty,prate,pamount,pgst,pgstvalue,ptotal,psub,ptime,ptime_ar,pid_ar,pname_ar,pqty_ar,prate_ar,ptotal_ar,psub_ar,pamount_ar,pgst_ar,pgstvalue_ar;
